style.css:
@-moz-document domain("discord.com") {
/* Background */
  .theme-dark {
    --background-primary: #004d00;
    --background-secondary: #006600;
    --background-tertiary: #007300;
    --background-accent: #008000;
    --background-floating: #003300;
    --scrollbar-thin-thumb: #004d00;
  }

  /* Texto */
  .theme-dark .title-29uC1r, .theme-dark .markup-2BOw-j {
    color: #00cc00;
  }

  /* Canais */
  .theme-dark .containerDefault-1ZnADq {
    background-color: #006600;
    color: #00cc00;
  }

  /* Mensagens */
  .theme-dark .message-2qnXI6 {
    background-color: #007300;
    color: #00cc00;
  }

  /* Texto das mensagens */
  .theme-dark .messageContent-2qWWxC {
    color: #00cc00;
  }

  /* Barra lateral */
  .theme-dark .sidebar-2K8pFh {
    background-color: #004d00;
  }

  /* Cabe√ßalho */
  .theme-dark .header-2o-2hj {
    background-color: #006600;
    color: #00cc00;
  }
}
